import logo from './logo.svg';
import Main from './views/Main';
import './App.css';
import {Routes,Route,Link,Navigate} from 'react-router-dom'
function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Main/>}/>
      </Routes>
    </div>
  );
}

export default App;
